function getOffset( el ) {
    var _x = 0;
    var _y = 0;
    var _w = el.offsetWidth - el.scrollWidth;
    var _h = el.offsetHeight - el.scrollHeight;
    while( el && !isNaN( el.offsetLeft ) && !isNaN( el.offsetTop ) ) {
        _x += el.offsetLeft - el.scrollLeft;
        _y += el.offsetTop - el.scrollTop;
        el = el.offsetParent;
    }
    return { top: _y, left: _x, width: _w, height: _h };
}

function initSwashMe() {
	var newel = document.createElement("a");
	newel.target = '_blank';
	newel.className = 'swash_btn';
	newel.id = "swashMe";
	newel.style.position= 'absolute';
	newel.style.display = false;
	newel.innerHTML= "<img width='40' height='40' style='background-color:white;' src='data:image/png;base64, '/> ";
	document.body.appendChild(newel);
	document.body.addEventListener("mousemove", swashMe);
}

function showSwashMe(x, y) {	
	let el = document.querySelector("#swashMe")
	el.style.top = y - 40 + 'px';
	el.style.left = x - 20 + 'px';
	el.style.position = "fixed";
	el.style.display = 'block';
}

function hideSwashMe(){
	let el = document.querySelector("#swashMe")
	el.style.display = 'none';
}

function swashMe(e){
	var cNodes = e.target.childNodes;
	if(cNodes.length > 0) {
		let text = cNodes[0].nodeValue;		
		if(text){
			let x = e.clientX;
			let y = e.clientY;
			let wallets = [...text.matchAll(/swash:\/\/(0x[a-fA-F0-9]+)/)]
			if(wallets.length > 0) {
				for(wallet of wallets) {
					showSwashMe(x,y);				
				}
			}
			else {
				hideSwashMe();
			}
		} 
		else {
			hideSwashMe();
		}		
	}
}